(window.webpackJsonp=window.webpackJsonp||[]).push([[58],{"4NDk":function(e){e.exports=[{id:1,type:"  librato_alert",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"name",description:"<strong>(Required)</strong> The name of the alert.\n",elementType:"li",listDepth:1},{name:"description",description:"<strong>(Required)</strong> Description of the alert.\n",elementType:"li",listDepth:1},{name:"active",description:"whether the alert is active (can be triggered). Defaults to true.\n",elementType:"li",listDepth:1},{name:"rearm_seconds",description:"minimum amount of time between sending alert notifications, in seconds.\n",elementType:"li",listDepth:1},{name:"services",description:"list of notification service IDs.\n",elementType:"li",listDepth:1},{name:"condition",description:"A trigger condition for the alert. Conditions documented below.\n",elementType:"li",listDepth:1},{name:"attributes",description:"A hash of additional attribtues for the alert. Attributes documented below.\n",elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/librato/r/alert.html",docType:""},{id:2,type:"  librato_metric",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"type",description:"<strong>(Required)</strong> The type of metric to create (gauge, counter, or composite).\n",elementType:"li",listDepth:1},{name:"name",description:"<strong>(Required)</strong> The unique identifier of the metric.\n",elementType:"li",listDepth:1},{name:"display_name",description:"The name which will be used for the metric when viewing the Metrics website.\n",elementType:"li",listDepth:1},{name:"description",description:"Text that can be used to explain precisely what the metric is measuring.\n",elementType:"li",listDepth:1},{name:"period",description:"Number of seconds that is the standard reporting period of the metric.\n",elementType:"li",listDepth:1},{name:"attributes",description:"The attributes hash configures specific components of a metric\u2019s visualization.\n",elementType:"li",listDepth:1},{name:"composite",description:"The definition of the composite metric.\n",elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/librato/r/metric.html",docType:""},{id:3,type:"  librato_service",properties:[{name:"",description:'<p>The following arguments are supported. Please check the <a href="https://github.com/librato/librato-services/tree/master/services">relevant documentation</a> for each type of alert.</p>',elementType:"p"},{name:"type",description:"<strong>(Required)</strong> The type of notificaion.\n",elementType:"li",listDepth:1},{name:"title",description:"<strong>(Required)</strong> The alert title.\n",elementType:"li",listDepth:1},{name:"settings",description:"<strong>(Required)</strong> a JSON hash of settings specific to the alert type.\n",elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/librato/r/service.html",docType:""},{id:4,type:"  librato_space",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"name",description:"<strong>(Required)</strong> The name of the space.\n",elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/librato/r/space.html",docType:""},{id:5,type:"  librato_space_chart",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"space_id",description:"<strong>(Required)</strong> The ID of the space this chart should be in.\n",elementType:"li",listDepth:1},{name:"name",description:"<strong>(Required)</strong> The title of the chart when it is displayed.\n",elementType:"li",listDepth:1},{name:"type",description:"<strong>(Optional)</strong> Indicates the type of chart. Must be one of line or\nstacked (default to line).\n",elementType:"li",listDepth:1},{name:"min",description:"<strong>(Optional)</strong> The minimum display value of the chart's Y-axis.\n",elementType:"li",listDepth:1},{name:"max",description:"<strong>(Optional)</strong> The maximum display value of the chart's Y-axis.\n",elementType:"li",listDepth:1},{name:"label",description:"<strong>(Optional)</strong> The Y-axis label.\n",elementType:"li",listDepth:1},{name:"related_space",description:"<strong>(Optional)</strong> The ID of another space to which this chart is\nrelated.\n",elementType:"li",listDepth:1},{name:"stream",description:"<strong>(Optional)</strong> Nested block describing a metric to use for data in the\nchart. The structure of this block is described below.\n",elementType:"li",listDepth:1},{name:"",description:"<p>The <code>stream</code> block supports:</p>",elementType:"p"},{name:"metric",description:"<strong>(Required)</strong> The name of the metric. May not be specified if\n<code>composite</code> is specified.\n",elementType:"li",listDepth:1},{name:"source",description:"<strong>(Required)</strong> The name of a source, or <code>*</code> to include all sources.\nThis field will also accept specific wildcard entries. For example\nus-west-*-app will match us-west-21-app but not us-west-12-db. Use % to\nspecify a dynamic source that will be provided after the instrument or\ndashboard has loaded, or in the URL. May not be specified if <code>composite</code> is\nspecified.\n",elementType:"li",listDepth:1},{name:"group_function",description:"<strong>(Required)</strong> How to process the results when multiple sources\nwill be returned. Value must be one of average, sum, breakout. If average or\nsum, a single line will be drawn representing the average or sum\n(respectively) of all sources. If the group_function is breakout, a separate\nline will be drawn for each source. If this property is not supplied, the\nbehavior will default to average. May not be specified if <code>composite</code> is\nspecified.\n",elementType:"li",listDepth:1},{name:"composite",description:"<strong>(Required)</strong> A composite metric query string to execute when this\nstream is displayed. May not be specified if <code>metric</code>, <code>source</code> or\n<code>group_function</code> is specified.\n",elementType:"li",listDepth:1},{name:"summary_function",description:'<strong>(Optional)</strong> When visualizing complex measurements or a\nrolled-up measurement, this allows you to choose which statistic to use.\nDefaults to "average". Valid options are: "max", "min", "average", "sum" or\n"count".\n',elementType:"li",listDepth:1},{name:"name",description:"<strong>(Optional)</strong> A display name to use for the stream when generating the\ntooltip.\n",elementType:"li",listDepth:1},{name:"color",description:'<strong>(Optional)</strong> Sets a color to use when rendering the stream. Must be a\nseven character string that represents the hex code of the color e.g.\n"#52D74C".\n',elementType:"li",listDepth:1},{name:"units_short",description:"<strong>(Optional)</strong> Unit value string to use as the tooltip label.\n",elementType:"li",listDepth:1},{name:"units_long",description:"<strong>(Optional)</strong> String value to set as they Y-axis label. All\nstreams that share the same units_long value will be plotted on the same\nY-axis.\n",elementType:"li",listDepth:1},{name:"min",description:"<strong>(Optional)</strong> Theoretical minimum Y-axis value.\n",elementType:"li",listDepth:1},{name:"max",description:"<strong>(Optional)</strong> Theoretical maximum Y-axis value.\n",elementType:"li",listDepth:1},{name:"transform_function",description:"<strong>(Optional)</strong> Linear formula to run on each measurement\nprior to visualization.\n",elementType:"li",listDepth:1},{name:"period",description:"<strong>(Optional)</strong> An integer value of seconds that defines the period this\nstream reports at. This aids in the display of the stream and allows the\nperiod to be used in stream display transforms.\n",elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/librato/r/space_chart.html",docType:""}]}}]);